import React , {Component} from "react";
import Children_header from "./Children_header";

class Header extends Component { 
    constructor(){
      super();
      this.state = {
        name : "Reda Eskouni",
      }
      //this.change_name = this.change_name.bind(this)
    }

    change_name = () =>{
      alert("stet are change")
      this.setState({ name:"Another Name"})
    }
    
    render(){
      return (
          <header>
            {this.state.name} <br/>
            <Children_header change_name={this.change_name} />
          </header>
      );
    }
}

export default Header;
